	file8 := &embedded.EmbeddedFile{
		Filename:    `help.html`,
		FileModTime: time.Unix(1466015030, 0),
		Content:     string("<!DOCTYPE html>\n<html lang=\"en\">\n\t<head>\n\t\t<meta charset=\"utf-8\" />\n\t\t<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\" />\n\t\t<meta name=\"viewport\" content=\"width=device-width, initial-scale=1\" />\n\n\t\t<title>SoundBert | Help</title>\n\n\t\t<link rel=\"shortcut icon\" href=\"/favicon.ico\" />\n\t\t<!-- Bootstrap core CSS -->\n\t\t<link rel=\"stylesheet\" href=\"/css/bootstrap-3.3.6.min.css\" />\n\t</head>\n\n\t<body>\n\t\t<div class=\"container\">\n\t\t\t<div class=\"page-header\">\n\t\t\t\t<h1>\n\t\t\t\t\t<a href=\"/\"><img src=\"/logo.png\" height=\"64\" alt=\"SoundBert Logo\" /></a>\n\t\t\t\t</h1>\n\t\t\t\t<p class=\"lead\">SoundBert - A simple REST based soundboard in Go.</p>\n\t\t\t</div>\n\n\t\t\t<h3>List all available snippets</h3>\n\t\t\t<p><span class=\"label label-primary\">GET</span> /list</p>\n\t\t\t<p>\n\t\t\t\tSample response:<br />\n\t\t\t\t<code>\n\t\t\t\t\t{\n\t\t\t\t\t\t\"foo\": \"foo.mp3\",\n\t\t\t\t\t\t\"bar/baz\": \"bar/baz.wav\"\n\t\t\t\t\t}\n\t\t\t\t</code>\n\t\t\t</p>\n\n\t\t\t<h3>Play a single snippet</h3>\n\t\t\t<p><span class=\"label label-primary\">POST</span> /play</p>\n\t\t\t<p>\n\t\t\t\tPost data example:<br />\n\t\t\t\t<code>filename=foo.mp3</code>\n\t\t\t</p>\n\t\t\t<p>\n\t\t\t\tSample response:<br />\n\t\t\t\t<code>{\"playing\":\"foo.mp3\"}</code>\n\t\t\t</p>\n\t\t\t<p>\n\t\t\t\tExample with path:<br />\n\t\t\t\t<code>filename=bar/baz.wav</code>\n\t\t\t</p>\n\t\t\t<p>\n\t\t\t\tResponse:<br />\n\t\t\t\t<code>{\"playing\":\"bar/baz.wav\"}</code>\n\t\t\t</p>\n\n\t\t\t<h3>Stop playback</h3>\n\t\t\t<p><span class=\"label label-primary\">GET</span> /stop</p>\n\n\t\t\t<h3>Reload sounds</h3>\n\t\t\t<p><span class=\"label label-primary\">GET</span> /reload_sounds</p>\n\n\t\t\t<hr />\n\n\t\t\t<a class=\"pull-left btn btn-default btn-xs\" href=\"/\">Back</a>\n\t\t\t<span class=\"pull-right\">\n\t\t\t\t<a href=\"/help.html\" class=\"text-muted\">Help</a> | <a href=\"http://iconka.com/\" class=\"text-muted\" target=\"_blank\">Logo by Denis Sazhin</a>\n\t\t\t</span>\n\n\t\t</div> <!-- /container -->\n\t</body>\n</html>\n"),
	}
	file9 := &embedded.EmbeddedFile{
		Filename:    `index.html`,
		FileModTime: time.Unix(1465809922, 0),
		Content:     string("<!DOCTYPE html>\n<html lang=\"en\">\n\t<head>\n\t\t<meta charset=\"utf-8\" />\n\t\t<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\" />\n\t\t<meta name=\"viewport\" content=\"width=device-width, initial-scale=1\" />\n\n\t\t<title>SoundBert</title>\n\n\t\t<link rel=\"shortcut icon\" href=\"/favicon.ico\" />\n\t\t<!-- Bootstrap core CSS -->\n\t\t<link rel=\"stylesheet\" href=\"/css/bootstrap-3.3.6.min.css\" />\n\t\t<style type=\"text/css\">\n\t\t#snippets .btn {\n\t\t\tpadding: 8px;\n\t\t\tmargin: 0 5px 5px 0;\n\t\t}\n\t\tfooter {\n\t\t\tpadding-bottom: 10px;\n\t\t}\n\t\t</style>\n\t</head>\n\t<body>\n\t\t<div class=\"container\">\n\t\t\t<div class=\"page-header\">\n\t\t\t\t<h1>\n\t\t\t\t\t<a href=\"/\"><img src=\"/logo.png\" height=\"64\" alt=\"SoundBert Logo\" /></a>\n\t\t\t\t\t<p class=\"lead\">SoundBert - A simple REST based soundboard in Go.</p>\n\t\t\t\t</h1>\n\t\t\t</div>\n\t\t\t<div id=\"snippets\"></div>\n\t\t\t<hr />\n\t\t\t<footer>\n\t\t\t\t<a class=\"pull-left btn btn-danger btn-xs\" id=\"stop\"><i class=\"glyphicon glyphicon-stop\"></i>&nbsp;Stop playback</a>\n\t\t\t\t<span class=\"pull-right\">\n\t\t\t\t\t<a href=\"/help.html\" class=\"text-muted\">Help</a> | <a href=\"http://iconka.com/\" class=\"text-muted\" target=\"_blank\">Logo by Denis Sazhin</a>\n\t\t\t\t</span>\n\t\t\t</footer>\n\t\t</div> <!-- /container -->\n\t\t<script type=\"text/javascript\">\n\t\t\t\tvar template = '<a class=\"btn btn-default\" data-snippet-url=\"{{ url }}\">{{ file }}</a>';\n\t\t\t\tvar labelTemplate = '<h4><span class=\"label label-default\">{{ label }}</span></h4><hr /><div data-id=\"{{ label }}\"></div>';\n\t\t</script>\n\t\t<script type=\"text/javascript\" src=\"/js/jquery-2.2.4.min.js\"></script>\n\t\t<script type=\"text/javascript\" src=\"/js/mustache-0.8.2.min.js\"></script>\n\t\t<script type=\"text/javascript\">\n\t\t\t$(document).ready(function() {\n\t\t\t\t$.getJSON('/list', function(data) {\n\t\t\t\t\tvar labelButtons = {};\n\t\t\t\t\taddLabel('unlabelled');\n\t\t\t\t\t$.each(data, function(file, url) {\n\t\t\t\t\t\tvar split = file.split('/');\n\t\t\t\t\t\tvar label = false;\n\t\t\t\t\t\tif (split.length > 1) {\n\t\t\t\t\t\t\tlabel = split[0];\n\t\t\t\t\t\t\tfile = split.pop();\n\n\t\t\t\t\t\t\tif (undefined === labelButtons[label]) {\n\t\t\t\t\t\t\t\tlabelButtons[label] = [];\n\t\t\t\t\t\t\t}\n\n\t\t\t\t\t\t\tlabelButtons[label].push({\n\t\t\t\t\t\t\t\tfile: file,\n\t\t\t\t\t\t\t\turl: url,\n\t\t\t\t\t\t\t\tlabel: label\n\t\t\t\t\t\t\t});\n\t\t\t\t\t\t}\n\t\t\t\t\t\telse {\n\t\t\t\t\t\t\taddSnippet(file, url, label);\n\t\t\t\t\t\t}\n\t\t\t\t\t});\n\n\t\t\t\t\t$.each(labelButtons, function(label, snippets) {\n\t\t\t\t\t\taddLabel(label);\n\t\t\t\t\t\t$.each(snippets, function(key, snippet) {\n\t\t\t\t\t\t\taddSnippet(snippet.file, snippet.url, label);\n\t\t\t\t\t\t});\n\t\t\t\t\t});\n\n\t\t\t\t\tfunction addSnippet(file, url, label) {\n\t\t\t\t\t\tvar button = Mustache.render(template, {\n\t\t\t\t\t\t\tfile: file,\n\t\t\t\t\t\t\turl: url\n\t\t\t\t\t\t});\n\n\t\t\t\t\t\tvar container = label ? $('div[data-id=\"'+label+'\"]') : $('#snippets');\n\t\t\t\t\t\tcontainer.append(button);\n\t\t\t\t\t}\n\n\t\t\t\t\tfunction addLabel(label) {\n\t\t\t\t\t\t$('#snippets').append(Mustache.render(labelTemplate, {label: label}));\n\t\t\t\t\t}\n\n\t\t\t\t\t$(document).on('click', '#snippets a', function() {\n\t\t\t\t\t\tvar btn = $(this);\n\t\t\t\t\t\tvar snippet = $(this).text();\n\t\t\t\t\t\tbtn.html('<i class=\"glyphicon glyphicon-play\"></i>&nbsp;'+snippet).removeClass('btn-default').addClass('btn-success');\n\t\t\t\t\t\t$.post('/play', {filename: btn.data('snippet-url')});\n\t\t\t\t\t\tsetTimeout(function() {\n\t\t\t\t\t\t\tbtn.text(snippet).removeClass('btn-success').addClass('btn-default');\n\t\t\t\t\t\t}, 2000);\n\t\t\t\t\t});\n\n\t\t\t\t\t$('#stop').on('click', function() {\n\t\t\t\t\t\t$.get('/stop');\n\t\t\t\t\t});\n\t\t\t\t});\n\t\t\t});\n\t\t</script>\n\t</body>\n</html>\n"),
	}
